import React from 'react'
import ContactForm from '../components/contactForm/ContactForm'
import Footer from '../components/footer/Footer'

const Contact = () => {
  return (
    <div>
        <ContactForm/>
        <Footer/>
    </div>
  )
}

export default Contact
